{
  "translationLines": [
    {
      "lineNumber": 151431,
      "originalJapaneseLine": "ラング・バウ――",
      "translatedEnglishLine": "Lang Bau――"
    },
    {
      "lineNumber": 151432,
      "originalJapaneseLine": "チュパ病から治ったロレックスとアミトスが",
      "translatedEnglishLine": "Rolex and Amitos, who had recovered from the Chupa disease,"
    },
    {
      "lineNumber": 151433,
      "originalJapaneseLine": "一心不乱に食事を取っていた。",
      "translatedEnglishLine": "were eating with single-minded focus."
    },
    {
      "lineNumber": 151434,
      "originalJapaneseLine": "「かぁーっ！　美味ぇ！",
      "translatedEnglishLine": "\"Kaaah! Delicious!"
    },
    {
      "lineNumber": 151435,
      "originalJapaneseLine": "　今日だけは酒よりも飯だ飯！」",
      "translatedEnglishLine": "Today, it's all about the food rather than the booze!\""
    },
    {
      "lineNumber": 151436,
      "originalJapaneseLine": "「ふふ、皆さんは今まで",
      "translatedEnglishLine": "\"Hehe, everyone until now"
    },
    {
      "lineNumber": 151437,
      "originalJapaneseLine": "　ほぼ飲まず食わずでしたからね」",
      "translatedEnglishLine": "had hardly eaten or drunk anything.\""
    },
    {
      "lineNumber": 151438,
      "originalJapaneseLine": "「ああ、病気の頃は何も食わずとも",
      "translatedEnglishLine": "\"Yeah, when I was sick, I didn’t eat anything but"
    },
    {
      "lineNumber": 151439,
      "originalJapaneseLine": "　不思議と平気だったんだが……",
      "translatedEnglishLine": "somehow I was fine... "
    },
    {
      "lineNumber": 151440,
      "originalJapaneseLine": "　元に戻った途端このありさまだ。あー、美味ぇ」",
      "translatedEnglishLine": "But the moment I got better, this is what happened. Ah, it’s delicious.\""
    },
    {
      "lineNumber": 151441,
      "originalJapaneseLine": "「しかし、本当に皆さんが元に戻って良かった」",
      "translatedEnglishLine": "\"Still, I’m truly glad everyone has returned to normal.\""
    },
    {
      "lineNumber": 151442,
      "originalJapaneseLine": "「おお、それで聞きたいんだが、",
      "translatedEnglishLine": "\"Oh, then I want to ask,"
    },
    {
      "lineNumber": 151443,
      "originalJapaneseLine": "　俺達が元に戻ったってこた、まさか……」",
      "translatedEnglishLine": "us getting back to normal means, could it be that...\""
    },
    {
      "lineNumber": 151444,
      "originalJapaneseLine": "「ええ、ケッセルリンクが死にました」",
      "translatedEnglishLine": "\"Yes, Kessel Link has died.\""
    },
    {
      "lineNumber": 151445,
      "originalJapaneseLine": "「うっしっ！　やってくれるぜ！",
      "translatedEnglishLine": "\"Yess! That’s great!"
    },
    {
      "lineNumber": 151446,
      "originalJapaneseLine": "　あの坊主！」",
      "translatedEnglishLine": "That brat!\""
    },
    {
      "lineNumber": 151447,
      "originalJapaneseLine": "「そうですか……",
      "translatedEnglishLine": "\"Is that so..."
    },
    {
      "lineNumber": 151448,
      "originalJapaneseLine": "　それは良かった……」",
      "translatedEnglishLine": "That’s good to hear...\""
    },
    {
      "lineNumber": 151449,
      "originalJapaneseLine": "そう呟くアミトスの顔は",
      "translatedEnglishLine": "Amitos’s face, muttering that, "
    },
    {
      "lineNumber": 151450,
      "originalJapaneseLine": "言葉とは裏腹に渋い。",
      "translatedEnglishLine": "was grim, contrary to his words."
    },
    {
      "lineNumber": 151451,
      "originalJapaneseLine": "「皆が命を賭けて戦っている中、",
      "translatedEnglishLine": "\"While everyone else is fighting risking their lives,"
    },
    {
      "lineNumber": 151452,
      "originalJapaneseLine": "　私は……」",
      "translatedEnglishLine": "I...\""
    },
    {
      "lineNumber": 151453,
      "originalJapaneseLine": "血が滲みそうなほど強く、",
      "translatedEnglishLine": "With a strength that made blood seem likely to seep,"
    },
    {
      "lineNumber": 151454,
      "originalJapaneseLine": "アミトスは己の拳を握った。",
      "translatedEnglishLine": "Amitos clenched his own fist."
    },
    {
      "lineNumber": 151455,
      "originalJapaneseLine": "「力が有り余っているようなら……",
      "translatedEnglishLine": "\"If you have surplus strength..."
    },
    {
      "lineNumber": 151456,
      "originalJapaneseLine": "　丁度良さそうですな」",
      "translatedEnglishLine": "It seems just right.\""
    },
    {
      "lineNumber": 151457,
      "originalJapaneseLine": "「なに？」",
      "translatedEnglishLine": "\"What?\""
    },
    {
      "lineNumber": 151458,
      "originalJapaneseLine": "「病み上がりに申し訳ありません。",
      "translatedEnglishLine": "\"I apologize for asking this so soon after your illness,"
    },
    {
      "lineNumber": 151459,
      "originalJapaneseLine": "　まだ戦は残っており、",
      "translatedEnglishLine": "the battle still remains,"
    },
    {
      "lineNumber": 151460,
      "originalJapaneseLine": "　皆さんのお力が必要なのです」",
      "translatedEnglishLine": "and your strength is still needed.\""
    },
    {
      "lineNumber": 151461,
      "originalJapaneseLine": "「おおっ、ありがてえ！",
      "translatedEnglishLine": "\"Oh, thank you!"
    },
    {
      "lineNumber": 151462,
      "originalJapaneseLine": "　奴らにゃ一杯食わされた！",
      "translatedEnglishLine": "They have made us suffer plenty!"
    },
    {
      "lineNumber": 151463,
      "originalJapaneseLine": "　返してやらにゃ気が済まねぇ！」",
      "translatedEnglishLine": "I won’t be satisfied until we pay them back!\""
    },
    {
      "lineNumber": 151464,
      "originalJapaneseLine": "「私も同じ気持ちです……」",
      "translatedEnglishLine": "\"I feel the same way...\""
    },
    {
      "lineNumber": 151465,
      "originalJapaneseLine": "「編成はこちらとなります」",
      "translatedEnglishLine": "\"This is the formation.\""
    },
    {
      "lineNumber": 151466,
      "originalJapaneseLine": "「ん？　こりゃあ……」",
      "translatedEnglishLine": "\"Hmm? This is...\""
    },
    {
      "lineNumber": 151467,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "…………"
    },
    {
      "lineNumber": 151468,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "……"
    },
    {
      "lineNumber": 151469,
      "originalJapaneseLine": "ヘルマンの荒野――",
      "translatedEnglishLine": "Helman Wilderness――"
    },
    {
      "lineNumber": 151470,
      "originalJapaneseLine": "「ふふん、1軍と5軍、合同の戦いかぁ……」",
      "translatedEnglishLine": "\"Hmph, the 1st and 5th armies, a joint battle, huh...\""
    },
    {
      "lineNumber": 151471,
      "originalJapaneseLine": "「元々の兵の数が少ないですからね」",
      "translatedEnglishLine": "\"It's because their original number of soldiers is small.\""
    },
    {
      "lineNumber": 151472,
      "originalJapaneseLine": "「おお、別働隊としてランス達も戦うらしい。",
      "translatedEnglishLine": "\"Oh, it seems Lance and the others will fight as a separate unit."
    },
    {
      "lineNumber": 151473,
      "originalJapaneseLine": "　言わばボーナスタイムだ」",
      "translatedEnglishLine": "So to speak, it's bonus time.\""
    },
    {
      "lineNumber": 151474,
      "originalJapaneseLine": "「ええ、四天王の一角、魔人ケッセルリンクの死に",
      "translatedEnglishLine": "\"Yes, with the death of Kessel Link, one of the Four Heavenly Kings,"
    },
    {
      "lineNumber": 151475,
      "originalJapaneseLine": "　魔軍はこれ以上なく動揺している」",
      "translatedEnglishLine": "the demon army is more shaken than ever.\""
    },
    {
      "lineNumber": 151476,
      "originalJapaneseLine": "「今こそ奪われ続けた領地、奪還の時」",
      "translatedEnglishLine": "\"Now is the time to reclaim the territories that have been continually taken.\""
    },
    {
      "lineNumber": 151477,
      "originalJapaneseLine": "「指揮は私が行います。",
      "translatedEnglishLine": "\"I will take command."
    },
    {
      "lineNumber": 151478,
      "originalJapaneseLine": "　お二人は存分に先頭に立ち",
      "translatedEnglishLine": "You two should lead from the front to your heart's content"
    },
    {
      "lineNumber": 151479,
      "originalJapaneseLine": "　兵の士気高揚に努めて下さい」",
      "translatedEnglishLine": "and strive to boost the soldiers' morale.\""
    },
    {
      "lineNumber": 151480,
      "originalJapaneseLine": "「士気高揚、ね。",
      "translatedEnglishLine": "\"Boosting morale, huh."
    }
  ]
}

